import styles from "../styles/Oandalive.module.css";
import oandametricsgif from "../assets/oanda_metrics.gif";
import oandametrics1 from "../assets/oanda_metrics1.gif";
import oandametrics2 from "../assets/oanda_metrics2.gif";
import oandametrics3 from "../assets/oanda_metrics3.gif";
import oandametrics4 from "../assets/oanda_metrics4.gif";
import oandametrics5 from "../assets/oanda_metrics5.gif";

function Oandalive() {
    return (
        <section className={styles.oandalive}>
            <h1>OANDA Live</h1>
            <img src={oandametricsgif} className={styles.oandametricsgif} alt="OANDA metrics" />
            <img src={oandametrics1} className={styles.oandametricsgif} alt="OANDA metrics" />
            <img src={oandametrics2} className={styles.oandametricsgif} alt="OANDA metrics" />
            <img src={oandametrics3} className={styles.oandametricsgif} alt="OANDA metrics" />
            <img src={oandametrics4} className={styles.oandametricsgif} alt="OANDA metrics" />
            <img src={oandametrics5} className={styles.oandametricsgif} alt="OANDA metrics" />
        </section>
    );
}

export default Oandalive;
